import React from 'react';

const Profile = () => {
  const user = {
    name: 'Juan Pérez',
    email: 'juanperez@email.com',
    level: 12,
    levelName: 'Gamer Avanzado',
    points: 2450,
    avatar: 'JP'
  };

  const achievements = [
    { icon: '🛒', title: 'Primera Compra' },
    { icon: '⭐', title: '1000 Puntos' },
    { icon: '❤️', title: 'Fan Nintendo' },
    { icon: '📝', title: 'Reseñador' }
  ];

  const recommendedGames = [
    {
      id: 5,
      title: 'Super Mario 3D World',
      platform: 'Nintendo Switch',
      image: 'https://thvnext.bing.com/th/id/OIP.K5mQLcjBLd3MXAPPI8huhgHaEJ?o=7&cb=ucfimg2rm=3&ucfimg=1&rs=1&pid=ImgDetMain&o=7&rm=3',
      rating: 4.6,
      reviews: 1234,
      price: 1200
    }
  ];

  const renderStars = (rating) => {
    const fullStars = Math.floor(rating);
    let stars = '';
    
    for (let i = 0; i < fullStars; i++) {
      stars += '⭐';
    }
    
    return stars;
  };

  return (
    <section id="perfil" className="section container">
      <h2>👤 Mi Perfil</h2>
      <div className="profile">
        <div className="profile__header">
          <div className="profile__avatar">{user.avatar}</div>
          <div className="profile__info">
            <h3>{user.name}</h3>
            <p>{user.email}</p>
            <div className="profile__level">
              Nivel {user.level} - {user.levelName}
            </div>
          </div>
          <div className="user-points" style={{fontSize: '1.1rem'}}>
            ⭐ {user.points.toLocaleString()} puntos disponibles
          </div>
        </div>

        <div className="achievements">
          <h4>🏆 Logros desbloqueados</h4>
          <div className="badges">
            {achievements.map((achievement, index) => (
              <div key={index} className="badge">
                <div className="badge__icon">{achievement.icon}</div>
                <div className="badge__title">{achievement.title}</div>
              </div>
            ))}
          </div>
        </div>

        <button className="btn btn--ghost">✏️ Editar perfil</button>
        <button className="btn btn--primary">🎁 Canjear puntos</button>
      </div>

      {/* Recomendaciones personalizadas */}
      <div className="recommendations">
        <h3>🎯 Recomendado para ti</h3>
        <p>Basado en tus compras previas y juegos similares que te gustan:</p>
        <div className="grid" style={{marginTop: '1rem'}}>
          {recommendedGames.map((game) => (
            <div key={game.id} className="card">
              <img src={game.image} alt={game.title} />
              <div className="card__body">
                <div className="card__platform">{game.platform}</div>
                <h3 className="card__title">{game.title}</h3>
                <div className="card__rating">
                  <span className="stars">{renderStars(game.rating)}</span>
                  <span>({game.rating}) {game.reviews.toLocaleString()} reseñas</span>
                </div>
                <div className="card__price">
                  <div className="price">${game.price.toLocaleString()} MXN</div>
                </div>
                <button className="btn btn--primary" style={{width: '100%', marginTop: '.5rem'}}>
                  🛒 Agregar al carrito
                </button>
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Profile;
